import {StyleSheet} from 'react-native';

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
    mapfree: {
      justifyContent: 'center',
      alignItems: 'center',
      height: 50,
      width: 50,
      borderWidth: 2,
      borderColor: 'red',
      backgroundColor: 'white'
    },
  
    mapblock: {
      justifyContent: 'center',
      alignItems: 'center',
      height: 50,
      width: 50,
      borderWidth: 2,
      borderColor: 'red',
      backgroundColor: 'red'
    },

    Trail: {
      justifyContent: 'center',
      alignItems: 'center',
      height: 50,
      width: 50,
      borderWidth: 2,
      borderColor: 'red',
      backgroundColor: 'green'
    },

    start: {
      justifyContent: 'center',
      alignItems: 'center',
      height: 50,
      width: 50,
      borderWidth: 2,
      borderColor: 'red',
      backgroundColor: 'blue'
    },

    startText: {
      color: 'blue',
      alignItems: 'center',
      justifyContent: 'center',
    },

    endText: {
      color: 'yellow',
      alignItems: 'center',
      justifyContent: 'center',
    },

    end: {
      justifyContent: 'center',
      alignItems: 'center',
      height: 50,
      width: 50,
      borderWidth: 2,
      borderColor: 'red',
      backgroundColor: 'yellow'
    },
  
    startbutton: {
      justifyContent: 'center',
      alignItems: 'center',
      height: 50,
      width: 100,
      borderWidth: 2,
      borderColor: 'red',
      backgroundColor: 'blue'
    },
  });

  export default styles;
